DROP TABLE IF EXISTS `lm_chat_messages`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lm_chat_messages` (
  `MESSAGE_ID` int NOT NULL AUTO_INCREMENT COMMENT '메시지 고유 ID',
  `ROOM_ID` int NOT NULL COMMENT '채팅방 ID',
  `SENDER_ID` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '메시지를 보낸 사용자 ID',
  `MESSAGE` text COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '메시지 내용',
  `CREATED_AT` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '메시지 전송 시간',
  `IS_READ` tinyint DEFAULT '0' COMMENT '메시지 읽음 여부 (0: 안 읽음, 1: 읽음)',
  PRIMARY KEY (`MESSAGE_ID`),
  KEY `idx_room_created` (`ROOM_ID`,`CREATED_AT`) COMMENT '채팅방별 시간순 조회 인덱스',
  KEY `idx_sender` (`SENDER_ID`) COMMENT '발신자 검색 인덱스',
  KEY `idx_is_read` (`IS_READ`) COMMENT '읽음 여부 검색 인덱스'
) ENGINE=InnoDB AUTO_INCREMENT=38 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='채팅 메시지 테이블';
