DROP TABLE IF EXISTS `lm_chat_rooms`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lm_chat_rooms` (
  `ROOM_ID` int NOT NULL AUTO_INCREMENT COMMENT '채팅방 고유 ID',
  `USER1_ID` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '첫 번째 사용자 ID (작은 값으로 정렬)',
  `USER2_ID` varchar(50) COLLATE utf8mb4_unicode_ci NOT NULL COMMENT '두 번째 사용자 ID (큰 값으로 정렬)',
  `CREATED_AT` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '채팅방 생성 시간',
  `UPDATED_AT` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '채팅방 마지막 업데이트 시간',
  `LAST_MESSAGE` text COLLATE utf8mb4_unicode_ci COMMENT '마지막 메시지 내용 (미리보기용)',
  `LAST_MESSAGE_TIME` datetime DEFAULT NULL COMMENT '마지막 메시지 전송 시간',
  PRIMARY KEY (`ROOM_ID`),
  UNIQUE KEY `unique_user_pair` (`USER1_ID`,`USER2_ID`) COMMENT '두 사용자 조합 중복 방지',
  KEY `idx_user1` (`USER1_ID`) COMMENT '첫 번째 사용자 검색 인덱스',
  KEY `idx_user2` (`USER2_ID`) COMMENT '두 번째 사용자 검색 인덱스'
) ENGINE=InnoDB AUTO_INCREMENT=14 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci COMMENT='채팅방 정보 테이블';
