DROP TABLE IF EXISTS `lm_follows`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lm_follows` (
  `FOLLOW_ID` int NOT NULL AUTO_INCREMENT COMMENT '팔로우 관계 고유 ID',
  `FOLLOWER_ID` varchar(50) NOT NULL COMMENT '팔로우를 하는 사용자 ID',
  `FOLLOWING_ID` varchar(50) NOT NULL COMMENT '팔로우를 받는 사용자 ID',
  `CREATED_AT` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '팔로우한 시각',
  PRIMARY KEY (`FOLLOW_ID`),
