--
-- Table structure for table `lm_markers`
--

DROP TABLE IF EXISTS `lm_markers`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `lm_markers` (
  `MARKER_ID` int NOT NULL AUTO_INCREMENT COMMENT '마커 고유 ID',
  `USER_ID` varchar(50) NOT NULL COMMENT '마커를 남긴 사용자 ID',
  `LATITUDE` decimal(10,8) NOT NULL COMMENT '마커의 위도',
  `LONGITUDE` decimal(11,8) NOT NULL COMMENT '마커의 경도',
  `LINE1` text NOT NULL COMMENT '3줄 글 첫째 줄',
  `LINE2` text COMMENT '3줄 글 둘째 줄 (NULL 가능)',
  `LINE3` text COMMENT '3줄 글 셋째 줄 (NULL 가능)',
  `IMAGE_URL` varchar(2048) DEFAULT NULL COMMENT '마커에 첨부된 이미지 URL (선택 사항)',
  `CREATED_AT` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '마커 생성 시각',
  `UPDATED_AT` datetime DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '마커 마지막 수정 시각',
  `LIKE_COUNT` int DEFAULT '0' COMMENT '마커 좋아요 수',
  `COMMENT_COUNT` int DEFAULT '0' COMMENT '마커 댓글 수',
  `IS_PUBLIC` tinyint(1) DEFAULT '1' COMMENT '마커 공개 여부 (TRUE: 공개, FALSE: 비공개)',
  `CATEGORY` varchar(20) DEFAULT 'GENERAL',
  PRIMARY KEY (`MARKER_ID`),
  KEY `idx_markers_category` (`CATEGORY`)
) ENGINE=InnoDB AUTO_INCREMENT=269 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

